import React from "react"

export default function Offers(props) {
  return (
    <div>
			{props.user.map((el) => (
				<div className="offer">
				<p
					key={el.id}
        >
          {el.text}
				</p>
				<button className="btn" onClick={props.delete()}>delete</button>
				</div>
      ))}
    </div>
  )
}
